import { render } from "solid-js/web";
import Info from "./info";

const pkg = {
  name: "solid-js",
  version: 1,
  speed: "⚡️",
  website: "https://solidjs.com",
};

function App() {
  return <Info {...pkg} />;
}

render(() => <App />, document.getElementById("app"));

export default function Info(props) {
  return (
    <p>
      Le package <code>{props.name}</code> est {props.speed} rapide. Télécharger la
      version {props.version} depuis{" "}
      <a href={`https://www.npmjs.com/package/${props.name}`}>npm</a> et{" "}
      <a href={props.website}>en apprendre plus ici</a>
    </p>
  );
}
